import React from "react";
import "./About.css";

const About = () => {
  return (
    <div className="about">
      <header>About Page</header>
      <p>
        Cheerleading in the UK is becoming more and more popular each year. To
        compensate for this, more competitions and more teams are becoming
        available. As a result, there is so much information flying around and
        it is never all in one place.{" "}
      </p>
    </div>
  );
};

export default About;
